note_models.css:
.card {
 font-family: arial;
 font-size: 20px;
 text-align: center;
 color: black;
 background-color: white;
}

.flag {
  text-align: center;
}

.flag img {
  height: 250px;
  box-shadow: 3px 3px 3px rgba(0, 0, 0, .3);
}

.note {
  font-size: 75%;
  font-style: italic;
  color: #333;
  margin-top: 5px;
}

